webpackJsonp([0xbefc712cc98ce000],{"./node_modules/json-loader/index.js!./.cache/json/javascript-loops-continue-statement.json":function(e,t){e.exports={data:{markdownRemark:{html:'<h2>Introduction</h2>\n<p>The <strong>continue</strong> statement terminates execution of the statements in the current iteration of the current or labeled loop, and continues execution of the loop with the next iteration.</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>continue;</code></pre>\n      </div>\n<p>If the <strong>continue</strong> statement is used in a labeled statement, the syntax is as follows:</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>continue labelName;</code></pre>\n      </div>\n<p>In contrast to the <strong>break</strong> statement, <strong>continue</strong> does not terminate the execution of the loop entirely; instead:  </p>\n<ul>\n<li>In a <code>while</code> loop, it jumps back to the condition.  </li>\n<li>In a <code>for</code> loop, it jumps to the update expression.</li>\n</ul>\n<p><a href=\'https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Statements/continue\' target=\'_blank\' rel=\'nofollow\'>MDN link</a> | <a href=\'https://msdn.microsoft.com/en-us/library/8de3fkc8.aspx\' target=\'_blank\' rel=\'nofollow\'>MSDN link</a></p>\n<h2>Examples</h2>\n<p>The following example shows a <code>while</code> loop that has a <strong>continue</strong> statement that executes when the value of <strong>i</strong> is 3. Thus, <strong>n</strong> takes on the values 1, 3, 7, and 12.</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>var i = 0;\nvar n = 0;\n\nwhile (i < 5) {\n  i++;\n\n  if (i === 3) {\n    continue;\n  }\n\n  n += i;\n  console.log (n);\n}</code></pre>\n      </div>\n<p><img src="//forum.freecodecamp.com/images/emoji/emoji_one/rocket.png?v=2" title=":rocket:" alt=":rocket:" class="forum-image"> <a href=\'https://repl.it/C7hx/0\' target=\'_blank\' rel=\'nofollow\'>Run Code</a></p>\n<p>In the following example, a loop iterates from 1 through 9. The statements between <strong>continue</strong> and the end of the <code>for</code> body are skipped because of the use of the <strong>continue</strong> statement together with the expression <code>(i &#x3C; 5)</code>.</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>for (var i = 1; i < 10; i++) {\n    if (i < 5) {\n        continue;\n    }\n    console.log (i);\n}</code></pre>\n      </div>\n<p><img src="//forum.freecodecamp.com/images/emoji/emoji_one/rocket.png?v=2" title=":rocket:" alt=":rocket:" class="forum-image"> <a href=\'https://repl.it/C7hs/0\' target=\'_blank\' rel=\'nofollow\'>Run Code</a></p>',fields:{slug:"/javascript/loops/continue-statement/"},frontmatter:{title:"Continue Statement"}}},pathContext:{slug:"/javascript/loops/continue-statement/"}}}});
